import useCart from '../Cart/handler/getCartHandler'

export function Cart() {
    const cart = useCart();
    console.log(cart);
    return (
        <div className='my-10 mx-10'>
            {cart.map((product) => (
                <div className='mt-10 bg-gray-100 mr-96'>
                    <img className='w-64 h-64 ' src={`http://localhost:3000` + product.image}/>
                </div>
            ))}
        </div>
    );
}
